import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
// import App from "./App";
import * as serviceWorker from "./serviceWorker";

const persons = [
  {
    name: "Ali"
  },
  {
    name: "Kazim"
  },
  {
    name: "Shaheer"
  },
  {
    name: "Asad"
  }
];


const element = React.createElement(
    "ol",
    null,
    persons.map(x => {
      return React.createElement("li", { key: x.name }, x.name);
    })
  );



// const element = React.createElement(
